import React, { Component } from 'react'

class Footer extends Component {
    render() {
        return (
            <div className="footerItem">
                <Link to="/footer">
                    <img src={homeIcon} alt="homeIcon" />
                </Link>
            </div>
        )
    }
}

export default Footer
